import React from "react";
import "./Hotels.css";
import Container from "../../UI/Container";

const Hotels = () => {
  return (
    <Container>
      <h3>Browse by property type</h3>
      <div className="hotel-type">
        {hotelType.map((type) => (
          <HType key={type.name} item={type} />
        ))}
      </div>
    </Container>
  );
};

export default Hotels;
